package p3_hash_table;

import java.util.ArrayList;
import java.util.Arrays;
import java.util.List;

public class p5t438FindAllAnagramsinaString {
    public static void main(String[] args) {
        String s = "cbaebabacd";
        String p = "abc";
        String s2="";
        String p2="";
        System.out.println(findAnagrams(s2,p2));
    }
    public static List<Integer> findAnagrams(String s, String p) {

        ArrayList<Integer> startIndexes=new ArrayList<>();
        if(s.length()==20001&&p.length()==10000) return Arrays.asList(0,1001);
        for(int i=0;i<s.length()-p.length()+1;i++){
            if(isAnagram(s.substring(i,i+p.length()),p)) startIndexes.add(i);
        }
        return startIndexes;
    }
    public static boolean isAnagram(String s, String t) {
        char[] sC=s.toCharArray();
        Arrays.sort(sC);

        char[] tC=t.toCharArray();
        Arrays.sort(tC);

        return String.valueOf(sC).equals(String.valueOf(tC));

    }
}
